    def rebalance_root(self, root, words_list) -> int:
        found = 0
        for [idx, length, w, count] in words_list:
            idx += 1
            if idx == length:
                found += count
                continue
            index = ord(w[idx]) - ord('a')
            root[index].append([idx, length, w, count])
        return found

