    def numMatchingSubseq(self, S: str, words: List[str]) -> int:
        # matches is a list of [index, caracter to match, length of word and word]
        root = [[] for _ in range(26)]
        c = collections.Counter(words)
        for w, count in c.items():
            index = ord(w[0]) - ord('a')
            root[index].append([0, len(w), w, count])
        found = 0
        for c in S:
            index = ord(c) - ord('a')
            words_list = root[index]
            root[index] = list()
            found += self.rebalance_root(root, words_list)
        return found

    def rebalance_root_rev(self, root, words_list) -> int:
        found = 0
        for [w, count, original_word] in words_list:
            if len(w) == 0:
                #print("Found %s" % original_word)
                found += count
                continue
            k = w.pop()
            index = ord(k) - ord('a')
            #print("Rebalance %s to index %d (k is %s)" % (original_word, index, k))
            root[index].append([w, count, original_word])
        return found

    def numMatchingSubseq(self, S: str, words: List[str]) -> int:
        # matches is a list of [index, caracter to match, length of word and word]
        root = [[] for _ in range(26)]
        c = collections.Counter(words)
        for w, count in c.items():
            l = list(w)
            index = ord(l.pop()) - ord('a')
            root[index].append([l, count, w])
        #print(root)
        found = 0
        for c in reversed(S):
            index = ord(c) - ord('a')
            words_list = root[index]
            root[index] = list()
            found += self.rebalance_root_rev(root, words_list)
        #assert(False)
        return found

