class Solution:
    def numMatchingSubseq(self, S: str, words: List[str]) -> int:
        def issubseq(word):
            i = 0
            for c in word:
                i = S.find(c, i) + 1
                if not i: return 0
            return 1

        c = collections.Counter(words)
        return sum(issubseq(word) * c[word] for word in c)





























